import React, { Component }from 'react';

class Vehicle extends Component {
    constructor(props) {
        super(props)
        this.state = {
            name: props.name
        }
    }

    componentWillMount() {
        fetch(this.state.name)
            .then(res => res.json())
            .then(json => this.setState({ name: json.name }));
    }

    render() {
        return <div>{this.state.name}</div>
    }
}

export default Vehicle;
